class CfnXAxisTicksLabels {
    constructor(svg, data, config) {
        this.svg = svg;
        this.data = data;
        this.config = config;
        this.svgG = this.svg.append('g');
        this.svgGTicks = this.svgG.append('g');
        this.svgGLabels = this.svgG.append('g');
            
        this.svgG.attr('id', this.config.id);
        this.svgGTicks.attr('id', this.config.id + 't');
        this.svgGLabels.attr('id', this.config.id + 'l');
        
        this.initialize();
        
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    initialize() {
        // It's a path so we append a path and add .datum. Instead of adding .data and then enter() and then append().
        this.gTicks = this.svgGTicks
            .selectAll('rect')
            .data(this.data)
            .enter()
            .append('rect');
           
        this.gLabels = this.svgGLabels
            .selectAll('text')
            .data(this.data)
            .enter()
            .append('text');
    }
    
    initTransform({transition, duration, delay, speedUp, fraction, nextOn}) {
        if (!this.initTransformDone) {
            
            this.gTicks
                .attr('x', (d) => d.x1)
                .attr('width', (d) => d.w1)
                .attr('y', (d) => d.y1)
                .attr('height', 0)
                .attr('fill', (d) => d.fill)
                .attr('stroke', 'none')
                .attr('rx', (d) => d.w1 / 4)
                .attr('ry', (d) => d.w1 / 4);
            
            this.gLabels
                .attr("opacity", 0)
                .attr('x', (d) => d.x1)
                .attr('y', (d) => d.yl1)
                .attr('fill', (d) => d.fill)
                .style("text-anchor", (d) => d.anchor)
                .style("alignment-baseline", (d) => d.alignmentBaseline)
                .text((d) => d.year)
                .style('font-family', this.config.fontFamily ? this.config.fontFamily : 'Gluten')
                .style("font-size", (d) => d.fontSize);
            
            this.initTransformDone = true;
        };
    }
    
    trans1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gTicks
                .transition(transition + 't')
                .delay(delay)
                .duration(duration)
                .attr('height', (d) => fraction < 0.5 ? 0 : d.h1);
            
            this.gLabels
                .transition(transition + 'l')
                .delay(delay)
                .duration(duration)   
                .attr("opacity", fraction < 0.5 ? 0 : 1)
                .on(nextOn, resolve);
               
        });
    }
    
    trans2({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gTicks
                .transition(transition + 't')
                .delay(delay)
                .duration(duration)
                .attr('y', (d) => d.y1 + fraction * (d.y2 - d.y1))
                .attr('opacity', (d) => 1 - fraction * 0.9);
            
            this.gLabels
                .transition(transition + 'l')
                .delay(delay)
                .duration(duration)                
                .attr('y', (d) => d.yl1 + fraction * (d.yl2 - d.yl1))
                .attr('opacity', (d) => 1 - fraction * 0.9)
                .on(nextOn, resolve);
               
        });
    }

    trans3({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gTicks
                .transition(transition + 't')
                .delay(delay)
                .duration(duration)
                .attr('opacity', (d) => 1 - (1 - fraction) * 0.9);
            
            this.gLabels
                .transition(transition + 'l')
                .delay(delay)
                .duration(duration)                
                .attr('opacity', (d) => 1 - (1 - fraction) * 0.9)
                .on(nextOn, resolve);
               
        });
    }

    trans4({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            var fractionDelay = Math.max(fraction * 1.1 - 0.1, 0);

            this.gTicks
                .transition(transition + 't')
                .delay(delay)
                .duration(duration)
                .attr('y', (d) => d.y2 + fractionDelay * (d.y1 - d.y2));
            
            this.gLabels
                .transition(transition + 'l')
                .delay(delay)
                .duration(duration)                
                .attr('y', (d) => d.yl2 + fractionDelay * (d.yl1 - d.yl2))
                .on(nextOn, resolve);
               
        });
    }
}

