var responseCurrent  = {'index':-1, 'progress': 0};
var responseCurrentStep = -1;
var responsePrevious = {'index':-1, 'progress': 0};
var responsePreviousStep = -1;

var isTransitioning = false;
var nextTransition;
var transitionQueue = [];
var lastctr;
var nthPush = 1;

function calculateFraction(row, currentStep) {
    if (currentStep < row.step) {
        return 0;
    } else if (currentStep > row.stepEnd) {
        return 1;
    } else {
        return (currentStep - row.step) / (row.stepEnd - row.step);
    }
}


function handleStepProgress(response) {
  
  responseCurrent = response;
  responsePreviousStep = responsePrevious.index + responsePrevious.progress;
  responseCurrentStep  = responseCurrent.index + responseCurrent.progress;
  
  var transitionsResponse;
  var direction;
  
  if (responsePrevious.index == -1) {
    // Initially any scroll is considered to go down, in case the page is loaded in the middle and someone scrolls up
    direction = 'down';
  } else {
    direction = responseCurrent.direction;
  }
  
	if (direction === 'down') {
	  transitionsResponse = transitionsUpDown
	    .filter((row) => row.down)
	    .filter((row) => row.stepEnd >= responsePreviousStep)
	    .filter((row) => row.step    <  responseCurrentStep);
	} else if (direction === 'up') {
	  transitionsResponse = transitionsUpDown
	    .filter((row) => row.up)
	    .filter((row) => row.step    <= responsePreviousStep)
	    .filter((row) => row.stepEnd >  responseCurrentStep)
	    .reverse();
	}
	
	responsePrevious = response;
	
	if (transitionsResponse.length >= 1) {
	  
	  // If many items are in the transition queu than divide the duration and delay
	  var nSteps  = [...new Set(transitionsResponse.map((d) => Math.round(d.step)) )].length;
	  var nPushes = [...new Set(transitionQueue.map((d) => Math.round(d.nthPush)) )].length;
	  
	  if (transitionQueue.length > 0) {
	    // var transitionSpeedUp = Math.max(1, Math.abs(Math.floor(transitionQueue[0].step) - Math.floor(responseCurrentStep)) - 1);
	    var transitionSpeedUp = Math.abs(Math.floor(transitionQueue[0].step) - Math.floor(responseCurrentStep));
	  } else {
	    var transitionSpeedUp = 1;
	  }
	  
	  transitionsResponse = transitionsResponse
	    .map((row) => ({
	      ...row, 
	      direction: direction,
	      nextOn: direction === 'up' ? row.nextOnUp : row.nextOnDown,
	      // duration: row.durationDefault / transitionSpeedUp, 
	      // delay: row.delayDefault / transitionSpeedUp,
	      // speedUp: transitionSpeedUp,
	      nthPush: nthPush,
	      fraction: calculateFraction(row, responseCurrentStep),
	    }));
	  
	  nthPush++;
	  
	  transitionsResponse.forEach(function(transition) { transitionQueue.push(transition); });
	  
	  if (!isTransitioning) {
	    runTransitionQueu();
	  }
	}
}

async function runTransitionQueu() {
  
  let nTransition;
  
  isTransitioning = true;
  
  while (transitionQueue.length > 0) {
      nTransition = transitionQueue.shift(); // get the next transition from the queue
      
      // console.warn("Add logic that checks if transitions can be removed from the queu because there is duplication of going up and down. Should that be here or where transitions are pushed up?");
      if (transitionQueue.length > 0) {
	        var transitionSpeedUp = Math.max(1, Math.abs(Math.floor(transitionQueue[transitionQueue.length - 1].step) - Math.floor(nTransition.step)) - 1);
	    } else {
	        var transitionSpeedUp = 1;
	    }
	    
	    nTransition.duration = nTransition.durationDefault / transitionSpeedUp;
	    nTransition.delay = nTransition.delayDefault / transitionSpeedUp;
	    nTransition.speedUp = transitionSpeedUp;
      
      await nTransition.transitionFunction({
          transition: nTransition.transition, 
          duration:   nTransition.duration, 
          delay:      nTransition.delay, 
          speedUp:    transitionSpeedUp, // nTransition.speedUp, 
          fraction:   nTransition.fraction, 
          nextOn:     nTransition.nextOn
      });

  }
  
  isTransitioning = false;
}
